    }

    change(i) {
        const travelForm = this.state.travelForm.slice();
        this.setState({ travelForm: travelForm })
    }

    renderTravelForm(i) {
        return (
            <TravelForm value={this.state.travelForm[i]} onChange={() => this.change(i)} />
        );
